import React from "react";
import { Radar, RadarChart, PolarGrid, PolarAngleAxis } from "recharts";
const Profile = ({ loggedInUser }) => {
    const userData = Object.entries(loggedInUser.data).map(e => ({
        name: e[0],
        value: e[1]
    }));
    return (
        <div>
            <h1> {loggedInUser.deaths} </h1>
            <h1> {loggedInUser.kills} </h1>
            <h1> {loggedInUser.assists} </h1>
            <RadarChart
                cx={300}
                cy={250}
                outerRadius={150}
                width={600}
                height={500}
                data={userData}
            >
                <PolarGrid />
                <PolarAngleAxis dataKey="name" />
                <Radar
                    name="Mike"
                    dataKey="value"
                    stroke="#8884d8"
                    fill="#8884d8"
                    fillOpacity={0.6}
                />
            </RadarChart>
        </div>
    );
};
export default Profile;
